import React from "react";
import { Component } from 'react'

class Octopus extends Component {
    constructor(){
      super();
      this.state = {
      octopus: []
  }
 }

  componentDidMount(){
    fetch('/octopus')
   .then(res => res.json())
   .then(octopus => {
    this.setState({octopus: octopus})
   })
  }

  render() {
   return <div>
    <p>octopus jsx</p>
    <p> 
      {
        this.state.octopus.map(octopus => 
          <p key={octopus.en}>hi {octopus} </p>
        )
      }
    </p>
   </div>;

  }
 }

